import React from 'react';
import './App.css';
import {fetchApi} from './apiCalls'

function App() {
  const routeData = fetchApi('routes')
  console.log('data:', routeData)
  return (
    <div className="App">
      <select className="select-box">
        <option>Select</option>
      </select>
    </div>
  );
}

export default App;
